        "을유-병인": "점수: 78/100<br>설명: 두 사람은 활기와 열정이 조화를 이루어 역동적이고 활기찬 관계를 형성합니다. 함께 있을 때 많은 목표를 달성할 수 있는 능력을 발휘하며, 서로에게 긍정적인 자극을 줍니다. 그러나 동일한 열정으로 인해 때때로 경쟁심이나 고집이 부딪혀 갈등이 발생할 수 있습니다. 이러한 상황을 피하기 위해서는 서로의 차이를 인정하고, 개별적인 공간을 존중하는 노력이 필요합니다. 상호 협력을 통해 긍정적인 면을 극대화하고 단점을 보완해 나간다면 안정적이고 활기찬 관계를 유지할 수 있습니다.",
